import logo from './logo.svg';
import './assets/css/App.css';
import AccountAnalytics from './views/AccountAnalytics';
import MentionStatistics from './views/MentionStatistics';
import {Navbar, Nav} from 'react-bootstrap';



function App() {
  return (
    <div className="App">
      <h2> Dashboard </h2>
      <Navbar bg="light" variant="light">
        <Navbar.Brand href="#home">Navbar</Navbar.Brand>
        <Nav className="mr-auto">
          <Nav.Link href="#AccountAnalytics">AccountAnalytics</Nav.Link>
          <Nav.Link href="#MentionStatistics">MentionStatistics</Nav.Link>
        </Nav>
      </Navbar>
    </div>
  );
}

export default App;


